
//Simulated Annealing assignment 

import java.awt.List;
import java.util.Random;
import java.util.Scanner;

public class Main {
	public static void main(String[] args)
	{// this is the main method where we call simulated annealing method (SimAnnealing) 
		System.out.println("start ...");
		StringBuilder x=new StringBuilder(); // create an object of class StringBuilder 
		x.append("010010"); //initialization of the solution x = 18 
		double T1=550 ; //Initialization of maximum temperature (scenario 1)
		double T2=150; //Initialization of maximum temperature (scenario 2)
		SimAnnealing(x , T1); //call the method for first scenarion T1=550
		SimAnnealing(x , T2); //call the method for second scenarion T2=150
	}//end main 
	
//Method that performs simulated annealing algorithm 	
public static void  SimAnnealing ( StringBuilder x, double t )
{
	double Ebest=0.0; //best objective function result 

	String BestSol=new String("000000"); //global maximum solution  x
	// create two objects of class StringBuilder
	StringBuilder currentSol=new StringBuilder();  // to store the currrent solution x
	StringBuilder neighborSol=new StringBuilder();// to store  the neighbor solution x'
	currentSol=x;
	neighborSol=x;
	double Temperature=t;
	
	while(Temperature>0.000001) //Stopping criteria 
	{
		/* Un-comment these to see the process in greater details
		System.out.println("___________________________________________________\n");
		System.out.printf("T = %f\n", Temperature);
		System.out.println("___________________________________________________\n");
		*/
		int i=0; // set the for loop controller i to zero for each temperature 
		for(i=0;i<200;i++)	
		{
			
		double E1=Function(Integer.parseInt(currentSol.toString(), 2)); //takes a binary string (base 2 ) and converts it to an integer then applies objective function F to it and stores it in E1
		String temp0=currentSol.toString(); //temporary store the current Solution 
		Random rand = new Random(System.currentTimeMillis());  // Generate a random variable based on current time seed 
		int Flip = rand.nextInt(6); //generate a random integer between 0 and 5 (Flipping Index)
		
		/*Un-comment these to see the process in greater details
		if(Temperature==550.0 && i==0)
		{
			System.out.println("Iteration ("+ (i+1) +")		Solution= 010010			E= " + E1 );
			i++;
		}
		*/
		
		neighborSol= FlipBit2(Flip,currentSol); //generate a random neighbor by calling method FlipBit2
		double E2= Function(Integer.parseInt(neighborSol.toString(), 2));//takes a binary string (base 2 ) and converts it to an integer then applies objective function F to it and stores it in E2
		String temp1=neighborSol.toString();//temporary store the neighbor Solution 
		/*Un-comment these to see the process in greater details
		System.out.println("Iteration ("+ (i+1) +")		Solution= " + currentSol + "			E= " + E2 );
		*/
		double E_delta= E2-E1; 
		//this is to store and safeguard the global maximum and its result since SA is memoryless
		if(Ebest<E1)
		{
			Ebest=E1;
			BestSol= temp0;
		}
		else if(Ebest<E2)
		{
			Ebest=E2;
			BestSol= temp1;
		}
		//this is the critera of deciding wether to accept or reject the neighbor solution
		if (E_delta<=0 || ProbabilityFunc(E_delta,Temperature)>=0.7)
			if(E1<E2)
				currentSol=neighborSol;	 //accepted 
		// else keep the current solution 

		}// end for loop

		Temperature=TemperatureFunc(Temperature);	// cooling function call 
	}//end while 
	System.out.println("The optimal solution for T = "+t+" is : "+ BestSol +" with F= "+Ebest);
}//End SimAnnealing 

//Method that computes and returns probability of acceptance --> "Acceptance Function" 
public static double ProbabilityFunc (double w, double t )
{
	double prob;
	prob=Math.exp(-w/t);
	return prob;
}//End probabilityFunc  

//Method that computes and returns new temperature --> " Cooling Function" 
public static double TemperatureFunc(double t)
{
	double newT;
	newT=t*0.9; //given function 
	return newT;
}//End TemperatureFunc

//Method that flips a bit (from 0 to 1 and vice versa) in the given string x at a given index i
public static StringBuilder FlipBit2(int i, StringBuilder y)
{
	if(y.charAt(i)=='0')
		y.setCharAt(i, '1');
	else
		y.setCharAt(i,'0');
	return y;
		
}//end FlipBit2 

//Method that performs a function on a given decimal number z --> "Objective Function" 
public static double Function(int z)
{
	double F;
	F=Math.pow(z*1.0 , 3*1.0) - 90*Math.pow(z*1.0 , 2*1.0) + 600*z + 100 ; //assignment given function 
	return F;
} //end Function 

}
